gTN(){return"1. Das Telas de Pais e Especialistas, transcreva as se\xe7\xf5es Atividades que Acalmam, Estereotipias/Manias e Atividades que Estressam, respectivamente, para as se\xe7\xf5es Atividades que Acalmam, Estereotipias/Manias e Atividades que Estressam na PessoaAut;\n2. Somente para a Tela principal, transcreva a se\xe7\xe3o Aspectos sociais e familiares para a se\xe7\xe3o de mesmo nome no Modelo de persona;\n3. Se houver inst\xe2ncias conflitantes, ou seja, inst\xe2ncias de se\xe7\xf5es diferentes nas telas Pais e Especialistas com o mesmo valor (por exemplo, uma determinada atividade pertence \xe0 se\xe7\xe3o Atividades estressantes em uma tela e essa mesma atividade aparece com a atividade calmante na tela outro), deve-se analisar e escolher um deles para compor a respectiva se\xe7\xe3o do PersonAut;\n4. Na se\xe7\xe3o PersonAut Demographic Characteristics, fa\xe7a o seguinte:\n5. Campo \u201cNome\u201d: D\xea um nome fict\xedcio para a persona;\n6. Campo \u201cIdade\u201d: escolha uma idade dentro da faixa et\xe1ria definida na se\xe7\xe3o de perfil da Tela de Pais ou Especialistas; \xc9\n7. Campo \u201cG\xeanero\u201d: defina um G\xeanero\n8. Na se\xe7\xe3o General Characteristics do Persona Canvas, fa\xe7a o seguinte:\n9. No campo \u201cIdioma:\u201d digite uma das seguintes op\xe7\xf5es: verbal, n\xe3o verbal, ecol\xe1lico verbal\n10. Campo \u201cSensibilidade ao Som\u201d: Preencha de acordo com a resposta a um dos itens 28 e 29 do FCA (28- Rea\xe7\xe3o exagerada a est\xedmulos auditivos; 29- Hipo-rea\xe7\xe3o a est\xedmulos auditivos). Ou seja, aquele que est\xe1 marcado como 1.\n11. Campo \u201cN\xedvel de Autismo\u201d \u2013 insira conforme definido na se\xe7\xe3o Perfil do APC (leve, moderado ou grave).\n12. Insira o gr\xe1fico VGA gerado pelo FCA eletr\xf4nico.\n13. Por fim, insira uma foto fict\xedcia ou um desenho de rosto para compor a imagem da Persona."},
