gTP(){return"Nesta atividade tamb\xe9m deve ser gerado outro objeto de empatia para a fase de idea\xe7\xe3o, que corresponde a um Mapa de Empatia, denominado EmpathyAut (ver Figura 16). As inst\xe2ncias EmpathyAut s\xe3o obtidas diretamente da FCA e do Requester Canvas (ASRC- Autistic's Software Requester Canvas)."},
