gWV(){return"O objetivo desta atividade \xe9 escolher, dentre as ideias sugeridas, aquelas que ir\xe3o efetivamente compor o aplicativo. Para tanto, sugere-se a utiliza\xe7\xe3o da t\xe9cnica do menu de ideias. Vale ressaltar que, havendo tempo suficiente, esta atividade pode ser realizada logo ap\xf3s a sess\xe3o de brainstorming."},
